import { BrowserRouter as Router, Route } from 'react-router-dom';
import Signin from './components/SignIn/Signin';
function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path='/' component={Signin} />
      </Router>
    </div>
  );
}

export default App;
